import React from "react";

const LoadingScreen = () => {
  return (
    <div className="loading-screen bg-white h-[100vh]">
      <div className="spinner">
        <div className="spinner-element">
          <img
            className="h-[100px] w-[100px]"
            src="https://pngimg.com/uploads/skull/skull_PNG56.png"
          ></img>
        </div>
      </div>
    </div>
  );
};

export default LoadingScreen;
